import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first product "Add to Cart" button in the featured products grid
    // Try to find the first .add-to-cart button inside .products-grid
    await page.waitForSelector('.products-grid .add-to-cart', { timeout: 5000 });

    // Get the first product card's title for verification
    const firstProductTitle = await page.$eval('.products-grid .product-card .product-title', el => el.textContent.trim());

    // Click the first "Add to Cart" button (stopPropagation is handled in page JS)
    const addToCartBtn = await page.$('.products-grid .add-to-cart');
    await addToCartBtn.click();

    // Wait for notification (success) to appear
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add_to_cart.png'));

    // Extract cart count (should be 1)
    await page.waitForSelector('#cartCount', { timeout: 5000 });
    const cartCount = await page.$eval('#cartCount', el => el.textContent.trim());

    // Open the cart modal by clicking the cart icon or cart div
    // Try both strategies: by id or class
    let cartSelector = '#cartIcon';
    let cartElement = await page.$(cartSelector);
    if (!cartElement) {
      // Try .cart (should be clickable)
      cartSelector = '.cart';
      await page.waitForSelector(cartSelector, { timeout: 5000 });
      cartElement = await page.$(cartSelector);
    }
    await cartElement.click();

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Wait for cart items to render
    await page.waitForSelector('#cartItems .cart-item', { timeout: 5000 });

    // Take screenshot of the cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal.png'));

    // Extract cart item title and quantity
    const cartItemTitle = await page.$eval('#cartItems .cart-item .cart-item-title', el => el.textContent.trim());
    const cartItemQuantity = await page.$eval('#cartItems .cart-item .quantity', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first product to cart and verified its presence in the cart modal.",
      extractedData: {
        firstProductTitle,
        cartCount,
        cartItemTitle,
        cartItemQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
